#!/bin/bash
# bkk03 zfs setup # Array of disks to be used
disks=("nvme1n1" "nvme2n1" "nvme3n1" "nvme4n1") # Size of the swap partition on each disk
swap_size="16G" # Create swap partition and ZFS partition on each disk
for disk in "${disks[@]}"; do echo "Creating partitions on /dev/${disk}" # Create the swap partition parted -s /dev/${disk} mklabel gpt parted -s /dev/${disk} mkpart primary linux-swap 1MiB ${swap_size} mkswap /dev/${disk}p1 swap_uuid=$(blkid -s UUID -o value /dev/${disk}p1) # Add the swap partitions to /etc/fstab so they're used on startup echo "UUID=${swap_uuid} none swap sw 0 0" >> /etc/fstab # Enable the swap partition echo "Enabling swap on /dev/${disk}p1" swapon /dev/${disk}p1 # Create the ZFS partition parted -s /dev/${disk} mkpart primary ${swap_size} 100% # Inform the OS of partition table changes partprobe /dev/${disk}
done
